@ioannisa 

Sure thing! 

 The only changes to the api surface is to add the optional fileName to the `KSafe()`,
and the addition of the `getFlow()` method.

```kotlin
// This should throw an exception, because there are illegal characters in the file name:
val ksafe = KSafe(applicationContext, "../session")
```

```kotlin
// This should use "session" as the file name instead of "eu_anifantakis_ksafe_datastore"
val ksafe = KSafe(applicationContext, "session")

// or for iOS, this should use "/session" instead of "/eu_anifantakis_ksafe_datastore.preferences_pb"
val ksafe = KSafe("session")
```

Flows are always more complicated to test, since they're reactive and make use of coroutines.

```kotlin
// An example data class representing our session.
@Serializable
data class Session(val userId: Long)

// flows - like the other retrieval methods, you can specify encrypted/not encrypted flag, default is to encrypt.
val sessionFlow: Flow<Session?> = ksafe.getFlow("my_session", null)

// then you should be able to collect on the flow, typically in a viewModel, but any coroutinescope will work:
scope.launch {
    sessionFlow.collectLatest {
        if (it != null) {
             // we have a session, do something with it.
        } else {
            // oh no, the session is null
        }
    }
}

```
Lets say the user logs in, you create the Session instance, and stuff it into the datastore.

```kotlin
ksafe.put("my_session", Session(userId = 123))
```

The flow would then respond to that insertion, emitting the updated value.  Note that, if you repeat the insert again, with the same value,  this would change the encrypted value that's stored in the datastore (a new iv, and the newly encrypted value should be completely different from the existing stored value).  This will cause the flow to emit the new value.  However, we use `distinctUntilChanged()` at several points to stop this from propagating up if there's no actual change.

Under the hood, on the Android side, nothing else changes - we don't use a different key for different files.

On the iOS side, since there's a key cleanup mechanism, when the fileName is specified, we replace the "encrypted_" prefix with the fileName as the prefix, so "session_" would be the prefix in the above example.
